const items = $input.all();
const item = items[0];
const body = item.json.body || item.json;
const binary = item.binary || {};
const file = binary.arquivo || binary.file || binary.data;

if (!file) throw new Error('Arquivo ausente');

const allowedFormats = ['pdf', 'jpg', 'jpeg', 'png'];
const mimeType = file.mimeType || '';
const fileExtension = mimeType.split('/')[1]?.toLowerCase() || '';

if (!allowedFormats.includes(fileExtension)) {
  throw new Error(`Formato não suportado: ${fileExtension}`);
}

const maxSize = 10 * 1024 * 1024;
const fileSize = file.data?.length || 0;

if (fileSize > maxSize) throw new Error('Arquivo muito grande');
if (fileSize === 0) throw new Error('Arquivo vazio');

return {
  json: {
    nomeArquivo: file.fileName || 'documento.pdf',
    emailFornecedor: body.emailFornecedor || 'nao-informado@example.com',
    metadata: body.metadata || {},
    tamanhoBytes: fileSize,
    tamanhoKB: (fileSize / 1024).toFixed(2),
    tamanhoMB: (fileSize / 1024 / 1024).toFixed(2),
    mimeType: mimeType,
    extensao: fileExtension,
    dataRecebimento: new Date().toISOString()
  },
  binary: {
    arquivo: file
  }
};
